description:
Maiden Heist, The (2009)  

Verenigde Staten
Komedie / Misdaad

geregisseerd door Peter Hewitt
met Morgan Freeman, Christopher Walken en William H. Macy

Drie museumbewaarders smeden een plan om alle kunstwerken die onlangs zijn overgeplaatst naar een ander museum terug te krijgen. De drie mannen zijn na de vele dienstjaren zo gehecht geraakt aan de kunstwerken dat ze niet meer zonder kunnen.

